const Skills = () => {
  return (
    <div id="skills">
      <div className="hd underline underline-offset-8 decoration-4 lg:ml-64 decoration-yellow-400">
        <h4 className="font-bold ml-6 ">My Skills</h4>
      </div>
      <div className="mb-1 text-base font-medium text-blue-700 ml-6 mt-5">Java</div>
      <div className="border-double border-4 border-sky-500 rounded-lg ml-6 ">
        <div className="bg-blue-600 h-2.5 rounded-full w-20 lg:ml-80"></div>
      </div>
      <div className="mb-1 text-base font-medium text-blue-700 ml-6">Java</div>
      <div className="bg-gray-200 rounded-full h-2.5 ml-6">
        <div className="bg-red-600 h-2.5 rounded-full w-20 lg:ml-80"></div>
      </div>
    </div>
  );
};
export default Skills;
